Here's an example of how you can convert an array of JSON objects to CSV format, where each JSON object inside the array can have different keys and can have overlapping keys:
```javascript
const csvWriter = require('csv-writer').createObjectCsvWriter;

const data = [
  {
    name: 'John Doe',
    age: 30,
    email: 'johndoe@example.com',
    address: {
      street: '123 Main St',
      city: 'Anytown',
      state: 'CA',
      zip: '12345'
    }
  },
  {
