    age: 25,
    email: 'janesmith@example.com',
    address: {
      street: '456 Oak St',
      city: 'Othertown',
      state: 'NY',
      zip: '54321'
    }
  }
];

const csvWriter = createObjectCsvWriter({
  path: 'output.csv',
  header: [
    {id: 'name', title: 'Name'},
    {id: 'age', title: 'Age'},
    {id: 'email', title: 'Email'},
    {id: 'address.street', title: 'Street'},
    {id: 'address.city', title: 'City'},
    {id: 'address.state', title: 'State'},
    {id: 'address.zip', title: 'Zip'}
  ]
});

data.forEach(row => {
  csvWriter.writeRecords([row]);
});

csvWriter.end();
```
